  ngOnInit() {// this.setForm();
  }

  filter(val) {
    return this.apiService.getall(`vendor/getVendorSelectItemList?search=${val.trim()}`).pipe(map(response => {
      const res = response; //if (res && res.length == 0)
      //  this.notifyService.showError("enter branch name")

      this.isCodeLoading = false;
      return res;
    }));
  }

  filterItems(val) {
    return this.apiService.getall(`purchaseOrder/GetItemNameSelectList?search=${val.trim()}`).pipe(map(response => {
      const res = response; //if (res && res.length == 0)
      //  this.notifyService.showError("enter branch name")

      this.isItemLoading = false;
      return res;
    }));
  }

  filterBranch(val) {
    return this.apiService.getall(`branch/getSelectSysBranchList?search=${val.trim()}`).pipe(map(response => {
      const res = response; //if (res && res.length == 0)
      //  this.notifyService.showError("enter branch name")

      this.isBranchLoading = false;
      return res;
    }));
  }

  search() {
    this.isLoading = true;
    this.apiService.getall(`purchaseReport/getPurchaseOrderSummaryList?orderType=${this.orderType}&isAllVendors=${this.isAllVendors}&type=${this.type}&itemCode=${this.itemControl.value}&branchCode=${this.branchCodeControl.value}&vendCode=${this.codeControl.value}&from=${this.utilService.getCommonDate(this.dateFrom)}&to=${this.utilService.getCommonDate(this.dateTo)}`).subscribe(res => {
      this.isLoading = false;

      if (res) {
        this.vendorList = res['list'];
        this.companyName = res['comapnyName'];
        this.companyAddress = res['address'];
        this.branchName = res['branchName'];
        this.logoURL = res['logoURL'];
        this.tranTotalCost = res['totalDrAmount'];
        this.tranDiscAmount = 0.00; // res['totalOpeningAmount'];

        this.taxes = res['totalCrAmount'];
        this.totalBalance = res['totalBalance'];
      }
    });
  }

  openPrint() {
    const printContent = document.getElementById("printcontainer");
    const WindowPrt = window.open('', '', 'left=0,top=0,width=2000,height=1000,toolbar=0,scrollbars=0,status=0');
    setTimeout(() => {
      WindowPrt.document.write(printContent.innerHTML);
      WindowPrt.document.close();
      WindowPrt.focus();
      WindowPrt.print();
      WindowPrt.close();
    }, 50);
  }

}

