export class PurchaseordersummaryComponent extends ParentPurchaseMgtComponent {
    constructor(fb, apiService, authService, utilService, notifyService) {
        super(authService);
        this.fb = fb;
        this.apiService = apiService;
        this.authService = authService;
        this.utilService = utilService;
        this.notifyService = notifyService;
        this.vendCode = '';
        this.isAllVendors = false;
        this.dateFrom = '';
        this.dateTo = '';
        this.type = 'All';
        this.orderType = 'po';
        //branchCode: string = '';
        this.vendorList = [];
        this.codeControl = new FormControl('');
        this.tranTotalCost = 0;
        this.taxes = 0;
        this.tranDiscAmount = 0;
        this.totalBalance = 0;
        this.companyName = '';
        this.companyAddress = '';
        this.branchName = '';
        this.isLoading = false;
        this.isCodeLoading = false;
        this.isBranchLoading = false;
        this.branchCodeControl = new FormControl('');
        this.isItemLoading = false;
        this.itemControl = new FormControl('');
        this.filteredOptions = this.codeControl.valueChanges.pipe(startWith(''), debounceTime(400), distinctUntilChanged(), switchMap((val) => {
            if (val.trim() !== '')
                this.isCodeLoading = true;
            return this.filter(val || '');
        }));
        this.filteredItemsOptions = this.itemControl.valueChanges.pipe(startWith(''), debounceTime(400), distinctUntilChanged(), switchMap((val) => {
            if (val.trim() !== '')
                this.isItemLoading = true;
            return this.filterItems(val || '');
        }));
        this.filteredBranchOptions = this.branchCodeControl.valueChanges.pipe(startWith(''), debounceTime(400), distinctUntilChanged(), switchMap((val) => {
            if (val.trim() !== '')
                this.isBranchLoading = true;
            return this.filterBranch(val || '');
        }));
    }
    ngOnInit() {
        // this.setForm();
    }
    filter(val) {
        return this.apiService.getall(`vendor/getVendorSelectItemList?search=${val.trim()}`)
            .pipe(map(response => {
            const res = response;
            //if (res && res.length == 0)
            //  this.notifyService.showError("enter branch name")
            this.isCodeLoading = false;
            return res;
        }));
    }
    filterItems(val) {
        return this.apiService.getall(`purchaseOrder/GetItemNameSelectList?search=${val.trim()}`)
            .pipe(map(response => {
            const res = response;
            //if (res && res.length == 0)
            //  this.notifyService.showError("enter branch name")
            this.isItemLoading = false;
            return res;
        }));
    }
    filterBranch(val) {
        return this.apiService.getall(`branch/getSelectSysBranchList?search=${val.trim()}`)
            .pipe(map(response => {
            const res = response;
            //if (res && res.length == 0)
            //  this.notifyService.showError("enter branch name")
            this.isBranchLoading = false;
            return res;
        }));
    }
    search() {
        this.isLoading = true;
        this.apiService.getall(`purchaseReport/getPurchaseOrderSummaryList?orderType=${this.orderType}&isAllVendors=${this.isAllVendors}&type=${this.type}&itemCode=${this.itemControl.value}&branchCode=${this.branchCodeControl.value}&vendCode=${this.codeControl.value}&from=${this.utilService.getCommonDate(this.dateFrom)}&to=${this.utilService.getCommonDate(this.dateTo)}`).subscribe(res => {
            this.isLoading = false;
            if (res) {
                this.vendorList = res['list'];
                this.companyName = res['comapnyName'];
                this.companyAddress = res['address'];
                this.branchName = res['branchName'];
                this.logoURL = res['logoURL'];
                this.tranTotalCost = res['totalDrAmount'];
                this.tranDiscAmount = 0.00; // res['totalOpeningAmount'];
                this.taxes = res['totalCrAmount'];
                this.totalBalance = res['totalBalance'];
            }
        });
    }
    openPrint() {
        const printContent = document.getElementById("printcontainer");
        const WindowPrt = window.open('', '', 'left=0,top=0,width=2000,height=1000,toolbar=0,scrollbars=0,status=0');
        setTimeout(() => {
            WindowPrt.document.write(printContent.innerHTML);
            WindowPrt.document.close();
            WindowPrt.focus();
            WindowPrt.print();
            WindowPrt.close();
        }, 50);
